import React from 'react';
import { Row, Col, Image, Container } from 'react-bootstrap';

const Banner = () => {
  const banners = [
    '/images/banner/category-image.jpg', // Banner 1
    '/images/banner/img1-top-sinrato1.jpg',    // Banner 2
    '/images/banner/img2-top-sinrato1.jpg',    // Banner 3
  ];

  return (
    <Container className="py-4">
      <Row>
        {banners.map((banner, index) => (
          <Col key={index} sm={12} md={6} lg={4} className="mb-3">
            <Image src={banner} alt={`Banner ${index + 1}`} fluid className="banner-image" />
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default Banner;
